-- ----------------------------
--  Table structure for `card_images`
-- ----------------------------
DROP TABLE IF EXISTS `card_images`;
CREATE TABLE `card_images` (
  `id` int(11) NOT NULL,
  `card_id` int(10) unsigned NOT NULL COMMENT '宅配卡id',
  `img` varchar(200) NOT NULL COMMENT '宅配卡图片',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='宅配卡-图片';

-- ----------------------------
--  Table structure for `card_use`
-- ----------------------------
DROP TABLE IF EXISTS `card_use`;
CREATE TABLE `card_use` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(11) unsigned NOT NULL COMMENT '使用人',
  `card_id` int(11) unsigned NOT NULL COMMENT '使用卡ID',
  `card_ use` int(11) unsigned NOT NULL COMMENT '使用次数',
  `use_time` datetime NOT NULL COMMENT '使用时间',
  `status` tinyint(1) unsigned NOT NULL COMMENT '使用状态 1: 未用 2: 已用 3: 退回',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_at` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `deleted_at` timestamp NULL DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='宅配卡使用记录';

-- ----------------------------
--  Table structure for `cards`
-- ----------------------------
DROP TABLE IF EXISTS `cards`;
CREATE TABLE `cards` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(200) NOT NULL COMMENT '名称',
  `category_id` int(11) unsigned NOT NULL COMMENT '宅配卡分类',
  `image` varchar(200) NOT NULL COMMENT '宅配卡图片',
  `description` text COMMENT '描述',
  `price` decimal(10,2) unsigned NOT NULL COMMENT '宅配卡价格',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '宅配卡状态 1: 已上架 2: 已下架',
  `number` int(11) unsigned NOT NULL COMMENT '共可用次数',
  `number_count` int(11) unsigned NOT NULL COMMENT '剩余可使用次数',
  `stock` int(11) unsigned NOT NULL COMMENT '库存',
  `sales_number` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '销量',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `deleted_at` timestamp NULL DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='宅配卡';

