-- ----------------------------
--  Table structure for `user_cards`
-- ----------------------------
DROP TABLE IF EXISTS `user_cards`;
CREATE TABLE `user_cards` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_id` int(11) unsigned NOT NULL COMMENT '用户ID',
  `card_id` int(11) unsigned NOT NULL COMMENT '宅配卡ID',
  `card_code` int(11) unsigned NOT NULL COMMENT '宅配卡卡号',
  `card_code_pw` int(11) unsigned NOT NULL COMMENT '宅配卡卡密',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '宅配卡状态 1: 未激活 2 : 已激活 3: 已用完 4:已失效',
  `number` int(3) unsigned NOT NULL DEFAULT '0' COMMENT '宅配卡次数',
  `number_count` int(3) unsigned NOT NULL DEFAULT '0' COMMENT '宅配卡可用次数',
  `number_last` int(3) unsigned NOT NULL DEFAULT '0' COMMENT '宅配卡剩余次数',
  `card_ source` int(1) NOT NULL COMMENT '宅配卡来源 1: 订单 2: 激活',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `deleted_at` timestamp NULL DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='用户-宅配卡';

-- ----------------------------
--  Table structure for `users`
-- ----------------------------
DROP TABLE IF EXISTS `users`;
CREATE TABLE `users` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `extend` varchar(200) DEFAULT NULL,
  `nickname` varchar(200) DEFAULT NULL COMMENT '微信名字',
  `openid` varchar(200) DEFAULT NULL COMMENT '微信openid',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  `deleted_at` timestamp NULL DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='用户信息';

